import React from 'react';
import { CProgress ,CProgressBar } from '@coreui/react'
import '../css/Competences.css';

const Competences = () => {

  return (
    <div className="comp_container">
        <h2 className="comp_h2">Comp√©tences</h2>
        <div className='comp_item'>
          <CProgress color="success" value={25} className='progress-bar-item'>
            <CProgressBar>Symfony</CProgressBar>
          </CProgress>
          <CProgress color="info" value={50} className='progress-bar-item'>
            <CProgressBar >Laravel</CProgressBar>
          </CProgress>
          <CProgress color="warning" value={75} className='progress-bar-item'>
            <CProgressBar>React Js</CProgressBar>
          </CProgress>
          <CProgress color="danger" value={100} className='progress-bar-item'>
            <CProgressBar>JAVA</CProgressBar>
          </CProgress>
        </div>
    </div>
  );
};

export default Competences;
